// import '../imports/utils'
import { Meteor } from 'meteor/meteor';
import { Players } from '../imports/api/players';

class Person {
  constructor(name = 'JhonD') {
    this.name = name;
  }
  getGreeting() {
    console.log('Hi I am ' + this.name);
  }
}

Meteor.startup(() => {
  let me = new Person('Mika');
  console.log(me.getGreeting());
});
